import Head from 'next/head'
import MainLAyout from '../components/Mainlayout'

export default function Import() {
  return (
    <MainLAyout>
      <Head>
     
      </Head>

    <main >
        <div className="homeContainer">
        <h1 className="settingHead rowTop">Settings</h1>
            <div className="row rowTop">  
                <div className="col-sm-3 settingText">File</div>
                <div class="col-md-6 mb-3">2332.docx</div>
            </div>
            <div className="row rowTop">  
                <div className="col-sm-3 settingText">Status</div>
                <div class="col-md-6 mb-3">Done</div>
            </div>
            <div className="row rowTop">  
                <div className="col-sm-3 settingText">List of costs</div>
                <form>
                <div class="custom-file">
                    <input type="file" class="custom-file-input" id="customFile"/>
                    <label class="custom-file-label" for="customFile">Choose file</label>
                </div>
                </form>
            </div>
            <div >  
            <button type="button" class="btn btn-primary">Reload</button>
            <div className="documentation">
            <h3 className="settingHead rowTop">Documentation</h3>
            <div className='docLinks'>
                <div className="docLink"><a dclassName="aLink">There is some link</a></div>
                
                </div>
            </div>
            </div>
        </div>
    </main>

      

      <style jsx>{`
       
       .rowTop{
        margin-top:20px;
        
    }
    td,th{
        border-top:none;
        border-left:2px solid white;
        border-bottom:2px solid #dee2e6;
        width:15%;
    }
    .documentation{
        display : flex;
        flex-direction:column;
    }
    .docLinks{
        margin-left:30px;
    }
    .docLink{
        text-decoration:underline;
        font-size:20px;
        color: #F26536;
        cursor: pointer;
        transition:text-decoration .1s linear;
    }
    .doclink:hover {
        text-decoration:none; 
    }
      `}</style>
    </MainLAyout>
  )
}
